import React from "react";
import dp from "../asset/hesong.png";

function DisplayPicture() {
  return (
    <div className="img">
      <img
        src={dp}
        alt="hesong"
        style={{ margin: "auto", display: "block", width: "100px" }}
      />
      <hr />
      <span>He Song, Koo</span>
    </div>
  );
}

export default DisplayPicture;
